The dollar cost average formula you have unfortunately doesn't account for selling shares (since the weight functions needs all positive weights).  So for example if you buy and sell 1 share at the same price, it shouldn't change your DCA, but this formula will. You can calculate the DCA manually just by adding a few lines to your MyPortfolio code. Just take the shares and prices array as an input, then keep track of the partial sums as you go through your for loop. Here's my code:

function MyPortfolio(tickers, quantity, prices) {
  var total = []
  var shares = {}
  var average = {}
  var partialSums = {}

  for (i=0; i<tickers.length; i++){
    var t = tickers[i].toString()

    if (t != "Cash"){
      if (t in shares){
        shares[t] += Number(quantity[i])
        partialSums[t] += Number(quantity[i]) * Number(prices[i])
      }
      else{
        shares[t] = Number(quantity[i])
        partialSums[t] = Number(quantity[i]) * Number(prices[i])
      }
    }
  }

  for (var ticker in shares){
    if (shares[ticker]>0){
      average[ticker] = partialSums[ticker] / shares[ticker]
      total.push([ticker, shares[ticker], average[ticker]])
    }
  }

  return total
}

Great tutorial! Your code could be optimized, here's an improved version:

function MyPortfolio(symbols, values) {
  const sums = symbols.reduce((map, ticker, i) => {
    ticker = ticker.toString();
    if (map[ticker]) {
      map[ticker] += Number(values[i]);
    } else {
      map[ticker] = Number(values[i]);
    }
    return map;
  }, {});

  return Object.entries(sums);
}

