  ssData.getRange('A:S').createFilter();
  ssData.getRange('A1').activate();
  var criteria = SpreadsheetApp.newFilterCriteria()
  .whenDateEqualTo(new Date(myDate))
  .build();
  ssData.getFilter().setColumnFilterCriteria(1, criteria);
};

